import React from "react";

function Leaderboard(props) {
    bool = props.isHidden
    return (
        <div className="leaderboard" style={bool ? visibility:hidden}>
            <h1>Leaderboard</h1>
            <div>
                {Array.from({ length: props.name.length }, (_, i) =>
                    <div>{i}. {props.name[i]}: {props.score[i]}</div>)}


            </div>
        </div>
    )
}
export default Leaderboard;
